import React, { lazy } from 'react'
import Tables from '../table/table.js'
import TableCard from '../table/TableCard.js';



const WidgetsDropdown = lazy(() => import('../widgets/WidgetsDropdown.js'))

const columns = [
  {
    dataField: "name",
    text: "Product Name",

  },
  {
    dataField: "price",
    text: "Price",

    sort: true
  },
  {
    dataField: "stock",
    text: "Stock",

  },
  {
    dataField: "origin",
    text: "Origin",

  },
  {
      dataField: "Action",
      text: "Action",

    }
];
const Dashboard = () => {
  return (
    <>
      <WidgetsDropdown />
      <Tables/>
      <TableCard columns={columns}/>

    </>
  )
}

export default Dashboard
